std::vector<double> linspace(double a, double b, double step=1.0) {
    std::vector<double> result;
    for (double x = a; x + EPS < b; x += step) {
        result.push_back(x);
    }
    result.push_back(b);
    return result;
}

std::vector<double> transform(const std::vector<double>& v, const std::function<double(double)>& f) {
    std::vector<double> result;
    result.reserve(v.size());
    for (const auto& e : v) {
        result.push_back(f(e));
    }
    return result;
}

template <class T>
bool equals(const std::vector<T>& first, const std::vector<T>& second) {
    if (first.size() != second.size()) {
        return false;
    }
    return std::equal(first.begin(), first.end(), second.begin(), [] (const T& a, const T& b) {
        return std::abs(a - b) / std::max(1., std::abs(a + b)) < EPS;
    });
}

std::vector<double> get_reference(int index, const std::vector<double>& xs) {
    if (index < 1 || index > 6) {
        throw std::runtime_error("Invalid function index");
    }
    return REF_FUNCTIONS[index - 1];
}

